import React, {Component} from "react";
import TopNavBar from "./TopNavBar";
import Divider from "antd/es/divider";
import slider1 from "../assets/images/slider1.png"
class ProjectDetailComponent extends Component{
    constructor(props) {
        super(props);
        this.state = {
            id: this.props.match.params.id,
            description: ''
        }
        console.log(this.state.id)
    }

    render() {
        return (
            <div>
                <TopNavBar />
                <div className="project-container">
                    <div className="project-title">
                        project name
                    </div>
                    <div className="project-detail">
                        <div className="project-detail-head">
                            <div className="project-detail-head-wrapper" >
                                <div className="project-detail-head-title">
                                    <img src="https://assets.laioffer.com/public/companyLogo/5239c173-cf55-4a43-86f5-e555ea3c44e4.png" height="120px" width="120px"/>
                                    <div className="project_title_right">
                                        <h2>Project name</h2>
                                        <span>company name</span>

                                    </div>
                                </div>
                            </div>
                        </div>
                        <Divider />
                        <div className="project-detail-body">
                            body
                        </div>

                    </div>

                </div>
            </div>
        )
    }
}

export default ProjectDetailComponent;
